cmd-welcome-help:
Active un message qui sera envoyé lorsque des utilisateurs rejoindront le serveur.
Si vous spécifiez un url d'une image, ça cachera automatiquement le lien.
Dans vos messages, vous pouvez utlisez les mots clés suivants et ils serront remplacés :

@name : le nom de l'utilisateur
@mention : mentionne l'utilisateur
@serv : le nom du serveur

cmd-goodbye-help:
